interface Props {
    time: number,
    key: number,
    selectedTime: number,
    setSelectedTime: Function
}

const handleClick = (props: Props) => {
    props.setSelectedTime(props.time)
}

export default function TimeButton(props: Props) {
    return (
    <tr>
        <td>
            <button className='timeButton' key={props.key} onClick={() => {handleClick(props)}}>
                {props.time}
            </button>
            { props.selectedTime === props.time && 
                <button className='confirmButton'>
                    Confirm
                </button>
            }
        </td>
    </tr>
    )
}
